\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSusman counted the words that appeared most frequently in the personality-driven advice manuals of the early twentieth century and compared them to the character guides of the nineteenth century. The earlier guides emphasized attributes that anyone could work on improving, described by words like Citizenship Duty Work Golden deeds Honor Reputation Morals Manners Integrity But the new guides celebrated qualities that were—no matter how easy Dale Carnegie made it sound—trickier to acquire. Either you embodied these qualities or you\n\nNovember 19, 2014\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdidn’t: Magnetic Fascinating Stunning Attractive Glowing Dominant Forceful Energetic\n\nI wonder if Japan is just on a big lag phase with America ...\n\nNovember 19, 2014\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYale’s president, Alfred Whitney Griswold, declared that the ideal Yalie was not a “beetle-browed, highly specialized intellectual, but a well-rounded man.” Another dean told Whyte that “in screening applications from secondary schools he felt it was only common sense to take into account not only what the college wanted, but what, four years later, corporations’ recruiters would want. ‘They like a pretty gregarious, active type,’ he said. ‘So we find that the best man is the one who’s had an 80 or 85 average in school and plenty of extracurricular activity. We see little use for the “brilliant” introvert.’ ”\n\nNovember 19, 2014\n\u001c38\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“ FOR THE ANXIETY THAT COMES FROM NOT FITTING IN ,”\n\nMid twentieth century men crazy about drugs for anxiety\n\nNovember 19, 2014\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cRespect for individual human personality has with us reached its lowest point,” observed one intellectual in 1921, “and it is delightfully ironical that no nation is so constantly talking about personality as we are. We actually have schools for ‘self-expression’ and ‘self-development,’ although we seem usually to mean the expression and development of the personality of a successful real estate agent.”\n\nNovember 19, 2014\n\u001c41\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEven T. S. Eliot’s famous 1915 poem The Love Song of J. Alfred Prufrock —in which he laments the need to “prepare a face to meet the faces that you meet\n\nJune 13, 2017\n\u001c41\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEliot’s Prufrock mostly worries about being looked at by “eyes that fix you in a formulated phrase” and pin you, wriggling, to a wall.\n\nNovember 19, 2014\n\u001c41\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut what do “sharp skills” look like? Should we become so proficient at self-presentation that we can dissemble without anyone suspecting? Must we learn to stage-manage our voices, gestures, and body language until we can tell—sell—any story we want? These seem venal aspirations, a marker of how far we’ve come—and not in a good way—since the days of Dale Carnegie’s childhood.\n\nNovember 19, 2014\n\u001c44\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cnowadays we tend to think that becoming more extroverted not only makes us more successful, but also makes us better people. We see salesmanship as a way of sharing one’s gifts with the world. This is why Tony’s zeal to sell to and be adulated by thousands of people at once is seen not as narcissism or hucksterism, but as leadership of the highest order.\n\nNovember 19, 2014\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd if one judges HBS by how well it prepares students for the “real world,” it seems to be doing an excellent job. After all, Don Chen will graduate into a business culture in which verbal fluency and sociability are the two most important predictors of success, according to a Stanford Business School study.\n\nNovember 19, 2014\n\u001c60\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOur action plan hinged on what the most vocal people suggested,” recalls the classmate. “When the less vocal people put out ideas, those ideas were discarded. The ideas that were rejected would have kept us alive and out of trouble, but they were dismissed because of the conviction with which the more vocal people suggested their ideas. Afterwards they played us back the videotape, and it was so embarrassing.”\n\nNovember 19, 2014\n\u001c62\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"13YSFRDRX3XLWVjEBCBzYo74GbAWucljgEpVmFNY","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"152N8JOJTtFDaKgs1DpfB245pz9M1-_S9bWNEVY4","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null