rseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="Zd14NjD0zGKgfMbowUH1f4hcNSw"  nonce="Zd14NjD0zGKgfMbowUH1f4hcNSw">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="Zd14NjD0zGKgfMbowUH1f4hcNSw"  nonce="Zd14NjD0zGKgfMbowUH1f4hcNSw">DOCS_modelChunk = [{"ty":"is","ibi":4325,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 19, 2014\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut when he analyzed what the highest-performing companies had in common, the nature of their CEOs jumped out at him. Every single one of them was led by an unassuming man like Darwin Smith . Those who worked with these leaders tended to describe them with the following words: quiet, humble, modest, reserved, shy, gracious, mild-mannered, self-effacing, understated. The lesson, says Collins, is clear. We don’t need giant personalities to transform\n\nI can do a better job with this regarding PT\n\nNovember 19, 2014\n\u001c67\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cpeople respected not just his formal authority, but also the way he led: by supporting his employees’ efforts to take the initiative. He gave subordinates input into key decisions, implementing the ideas that made sense, while making it clear that he had the final authority.\n\nNovember 19, 2014\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001che simply assigned work to those who could perform it best. This meant delegating some of his most interesting, meaningful, and important tasks—work that other leaders would have kept for themselves.\n\nNovember 19, 2014\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cstudies were often based on people’s perceptions of who made a good leader, as opposed to actual results. And personal opinions are often a simple reflection of cultural bias.\n\nNovember 19, 2014\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001chypothesis was that extroverted leaders enhance group performance when employees are passive, but that introverted leaders are more effective with proactive employees. T\n\nNovember 19, 2014\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cConnecting people to fix the world over time is the deepest spiritual value you can have,”\n\nNovember 20, 2014\n\u001c76\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHow come Craig organically can touch lives on so many personal levels—and Craig’s users can touch each other’s lives on so many levels?” Here’s one answer: social media has made new forms of leadership possible for scores of people who don’t fit the Harvard Business School mold\n\nNovember 20, 2014\n\u001c76\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cStudies have shown that, indeed, introverts are more likely than extroverts to express intimate facts about themselves online that their family and friends would be surprised to read, to say that they can express the “real me” online, and to spend more time in certain kinds of online discussions. They welcome the chance to communicate digitally. The same person who would never raise his hand in a lecture hall of two hundred people might blog to two thousand, or two million\n\nNovember 20, 2014\n\u001c77\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCooperative learning enables skills in working as teams—skills that are in dire demand in the workplace,”\n\nBrainstorm in teams. Feedback in teams. But work alone. Its your passion. Its your responsibility. Change this about PT\n\nNovember 20, 2014\n\u001c93\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cif we appreciated that not everyone aspires to be a leader in the conventional sense of the word—that some people wish to fit harmoniously into the group, and others to be independent of\n\nNovember 20, 2014\n\u001c93\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHence leadership does not only apply in social situations, but also occurs in more solitary situations such as developing new techniques in the arts, creating new philosophies, writing profound books and making scientific breakthroughs\n\nNovember 20, 2014\n\u001c93\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThey found a striking difference among the groups. All three groups spent the same amount of time—over fifty hours a week—participating in music-related activities. All three had similar classroom requirements making demands on their time. But the two best groups spent most of their music-related time practicing in solitude : 24.3 hours a week, or 3.5 hours a day, for the best group, compared with only 9.3 hours a week, or 1.3 hours a day, for the worst group. The best violinists rated “practice alone” as the most important of all their\n\nTho sometimes its good to have that woz garage experience. To get that initial motivation.\n\nNovember 20, 2014\n\u001c96\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDeliberate Practice is best conducted alone for several reasons. It takes intense concentration, and other people can be distracting. It requires deep motivation, often self-generated. But most important, it involves working on the task that’s most challenging to you personally. Only when you’re alone, Ericsson told me, can you “go directly to the part that’s challenging to you. If you want to improve what you’re doing, you have to be the one who generates the move. Imagine a group class—you’re the one generating the move onl\n\nNovember 20, 2014\n\u001c97\n\u0011\n\u0011"},{"ty":"te","id":"i.12","spi":4334},{"ty":"te","id":"i.13","spi":4371},{"ty":"te","id":"i.14","spi":4907},{"ty":"te","id":"i.15","spi":5221},{"ty":"te","id":"i.16","spi":5459},{"ty":"te","id":"i.17","spi":5673},{"ty":"te","id":"i.