mStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="Zd14NjD0zGKgfMbowUH1f4hcNSw"  nonce="Zd14NjD0zGKgfMbowUH1f4hcNSw">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="Zd14NjD0zGKgfMbowUH1f4hcNSw"  nonce="Zd14NjD0zGKgfMbowUH1f4hcNSw">DOCS_modelChunk = [{"ty":"is","ibi":8841,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI acquired a central ability that was to help me through my entire career: patience. I’m serious. Patience is usually so underrated. I mean, for all those projects, from third grade all the way to eighth grade, I just learned things gradually, figuring out how to put electronic devices together without so much as cracking a book.… I learned to not worry so much about the outcome, but to concentrate on the step I was on and to try to do it as perfectly as I could when I was doing it.\n\nNovember 20, 2014\n\u001c98\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you have talented and motivated people, they should be encouraged to work alone when creativity or efficiency is the highest priority.”\n\nNovember 20, 2014\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe one exception to this is online brainstorming. Groups brainstorming electronically, when properly managed, not only do better than individuals, research shows; the larger the group, the better it performs. The same is true of academic research—professors who work together electronically, from different physical locations, tend to produce research that is more influential than those either working alone or collaborating face-to-face.\n\nNovember 20, 2014\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat created Linux, or Wikipedia, if not a gigantic electronic brainstorming session? But we’re so impressed by the power of online collaboration that we’ve come to overvalue all group work at the expense of solo thought. We fail to realize that participating in an online working group is a form of solitude all its own. Instead we assume that the success of online collaborations will be replicated in the face-to-face world. Indeed, after all these years of evidence that conventional brainstorming groups don’t work, they remain as popular as ever. Participants in brainstorming sessions usually believe that their group performed much better than it actually did, which points to a valuable reason for their continued popularity—group brainstorming makes people feel attached. A worthy goal, so long as we understand that social glue, as opposed to creativity, is the principal benefit.\n\nHmm maybe we do a post your dreams and group brainstorm on resources to achieve... That might help...\n\nNovember 20, 2014\n\u001c106\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPsychologists usually offer three explanations for the failure of group brainstorming. The first is social loafing : in a group, some individuals tend to sit back and let others do the work. The second is production blocking : only one person can talk or produce an idea at once, while the other group members are forced to sit passively. And the third is evaluation apprehension , meaning the fear of looking stupid in front of one’s peers. Osborn’s “rules” of brainstorming were meant to neutralize this anxiety, but studies show that the fear of public humiliation is a potent force\n\nNovember 20, 2014\n\u001c106\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHmm, I’m not sure, but they all think the answer’s A, so I’ll go with that.” Nor are you saying, “I want them to like me, so I’ll just pretend that the answer’s A.” No, you are doing something much more unexpected—and dangerous. Most of Berns’s volunteers reported having gone along with the group because “they thought that they had arrived serendipitously at the same correct answer.” They were utterly blind, in other words, to how much their peers had influenced them.\n\nNovember 20, 2014\n\u001c109\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSometimes they picked the right answer despite their peers’ influence. And Berns and his team found something very interesting about these moments. They were linked to heightened activation in the amygdala, a small organ in the brain associated with upsetting emotions such as the fear of rejection. Berns refers to this as “the pain of independence,\n\nNovember 20, 2014\n\u001c109\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut when the group is literally capable of changing our perceptions, and when to stand alone is to activate primitive, powerful, and unconscious feelings of rejection, then the health of these institutions seems far more vulnerable than we thin\n\nNovember 20, 2014\n\u001c109\n\u0011\n\u0011"},{"ty":"te","id":"i.26","spi":8850},{"ty":"te","id":"i.27","spi":9376},{"ty":"te","id":"i.28","spi":9554},{"ty":"te","id":"i.29","spi":10034},{"ty":"te","id":"i.30","spi":11068},{"ty":"te","id":"i.31","spi":11693},{"ty":"te","id":"i.32","spi":12205},{"ty":"te","id":"i.33","spi":12595},{"ty":"as","st":"paragraph","si":8841,"ei":8841,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8842,"ei":8842,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8843,"ei":8843,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":8845,"ei":8845,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":